from datetime import datetime
from typing import List, Dict, Any, Optional

class User:
    def __init__(self, user_type: str, username: str):
        self.user_type = user_type
        self.username = username

class Submission:
    def __init__(self, submission_id: str, status: str, user: User):
        self.submission_id = submission_id
        self.status = status
        self.user = user
        self.create_time = datetime.now()
        self.update_time = self.create_time
        self.errors = []

    def update_status(self, new_status: str):
        self.status = new_status
        self.update_time = datetime.now()

    def add_error(self, error_message: str):
        self.errors.append(error_message)

class FABSSubmission(Submission):
    def __init__(self, submission_id: str, user: User):
        super().__init__(submission_id, 'Pending', user)

class Validator:
    @staticmethod
    def validate(submission: FABSSubmission) -> bool:
        if submission.submission_id.startswith("FABS"):
            return True
        submission.add_error("Invalid Submission ID format.")
        return False

class Logger:
    @staticmethod
    def log(message: str):
        print(f"{datetime.now()} - {message}")

class UI:
    def __init__(self):
        self.resources_page_style = None

    def redesign_resources_page(self, new_style: str):
        self.resources_page_style = new_style
        Logger.log(f"Resources page redesigned to match new style: {new_style}")

class UserTesting:
    @staticmethod
    def report_to_agencies(test_results: Dict[str, Any]):
        Logger.log("Reported user testing results to agencies.")

class DABS:
    @staticmethod
    def move_to_round_2():
        Logger.log("Moved to round 2 of DABS landing page edits.")

class Homepage:
    @staticmethod
    def move_to_round_2():
        Logger.log("Moved to round 2 of Homepage edits.")

class HelpPage:
    @staticmethod
    def move_to_round_3():
        Logger.log("Moved to round 3 of Help page edits.")

class Developer:
    @staticmethod
    def log_developer_activity(activity: str):
        Logger.log(f"Developer activity: {activity}")

    @staticmethod
    def update_validation_rules():
        Logger.log("Updated Broker validation rule table as per DB-2213.")

class DataUser:
    @staticmethod
    def process_deletions(date: str):
        Logger.log(f"Processed deletions for date: {date}")

class AgencyUser:
    def __init__(self, name: str):
        self.name = name

    def include_flexfields(self):
        Logger.log(f"{self.name} included flexfields without performance impact.")

class Application:
    def __init__(self):
        self.submissions: List[FABSSubmission] = []

    def upload_submission(self, submission_id: str, user: User):
        submission = FABSSubmission(submission_id, user)
        if Validator.validate(submission):
            self.submissions.append(submission)
            Logger.log(f"Submission {submission_id} uploaded successfully by {user.username}.")
        else:
            Logger.log(f"Submission {submission_id} failed validation.")

